import React from "react";
import "./App.css";
import Navbar from "./components/NavBar";
import SongDetails from "./components/SongDetails";
import SongForm from "./components/SongForm";
import SongContextProvider from "./contexts/SongContext";

function App() {
  return (
    <div className="App">
      <SongContextProvider>
        <Navbar />
        <SongForm />
        <SongDetails />
      </SongContextProvider>
    </div>
  );
}

export default App;
